function report() {
    var tab_text="";
    var textRange; var j=0;
    tab = document.getElementById('myidKiu_h2bpm_guoyu'); // id of table
	console.log(tab.value);

    for(j = 0 ; j < tab.value.split('').length ; j++) 
    {
		if(j % 10 == 0 && j == 0){
			tab_text+=`${tab.value.split('')[j] + '\t'},`;
		} else if(j % 10 == 9) {
			tab_text+=`${tab.value.split('')[j] + '\t'},`+"\n";
		} else {
			tab_text+=`${tab.value.split('')[j] + '\t'},`;
		} 
    }   
	while(j % 20 != 0){
		if(j % 10 == 0 && j == 0){
			tab_text=tab_text+"\t";
		} else if(j % 10 == 9) {
			tab_text=tab_text+"\t"+"\n";
		} else {
			tab_text=tab_text+"\t";
		}
		j++;
	}  
    var textRange; var j=0;
    tab = document.getElementById('myidXin_h2bpm_guoyu2'); // id of table
	console.log(tab.value);

    for(j = 0 ; j < tab.value.split(' ').length ; j++) 
    {
		if(j % 10 == 0 && j == 0){
			tab_text+=`${tab.value.split(' ')[j] + '\t'},`;
		} else if(j % 10 == 9) {
			tab_text+=`${tab.value.split(' ')[j] + '\t'},`+"\n";
		} else {
			tab_text+=`${tab.value.split(' ')[j] + '\t'},`;
		}
    }   
	while(j % 20 != 0){
		if(j % 10 == 0 && j == 0){
			tab_text=tab_text+"\t";
		} else if(j % 10 == 9) {
			tab_text=tab_text+"\t"+"\n";
		} else {
			tab_text=tab_text+"\t";
		}
		j++;
	}  
    tab_text= tab_text.replace(/<A[^>]*>|<\/A>/g, "");//remove if u want links in your table
    tab_text= tab_text.replace(/<img[^>]*>/gi,""); // remove if u want images in your table
    tab_text= tab_text.replace(/<input[^>]*>|<\/input>/gi, ""); // reomves input params

    var ua = window.navigator.userAgent;
    var msie = ua.indexOf("MSIE "); 

    if (msie > 0 || !!navigator.userAgent.match(/Trident.*rv\:11\./))      // If Internet Explorer
    {
        txtArea1.document.open("txt/html","replace");
        txtArea1.document.write(tab_text);
        txtArea1.document.close();
        txtArea1.focus(); 
        sa=txtArea1.document.execCommand("SaveAs",true,"Say Thanks to Sumit.xlsx");
    }  
    else                 //other browser not tested on IE 11
	{
		//encodeURIComponent解決中文亂碼
		let uri = 'data:text/csv;charset=utf-8,\ufeff' + encodeURIComponent(tab_text);
		//通過建立a標籤實現
		var link = document.createElement("a");
		link.href = uri;
		//對下載的檔案命名
		link.download =  "json資料表.csv";
		document.body.appendChild(link);
		link.click();
		document.body.removeChild(link);
	}

}

